import React, { useState } from "react";
import AppointmentCard from "./AppointmentCard"; // Import AppointmentCard component

const ParentComponent = () => {
  const [showAppointment, setShowAppointment] = useState(false);

  return (
    <div>
      <button className="request-btn" onClick={() => setShowAppointment(true)}>
        Request Call Back
      </button>

      {/* Show the AppointmentCard if showAppointment is true */}
      {showAppointment && <AppointmentCard onClose={() => setShowAppointment(false)} />}
    </div>
  );
};

export default ParentComponent;
